		"id": 794205884117229600,
		"id_str": "794205884117229568",
		"text": "\"영화학자 로빈 우드는 비평가는 열정적으로 특수한 작업에 몰두하며 가치판단에 도달하는 사람이라 말했다. 이런 정의에 동의한다. 리뷰가 영화라는 대상에 대한 기술이라면 비평은 영화라는 타자에 대한 개입이다. 스스로의 주견이 없다면 누군가에 대한 개입도-",
