		"id_str": "794204233977339904",
		"text": "\"GV가 훨씬 유력한 수익모델이기 때문이다. GV는 당연히 지면 비평보다 진입장벽도 높다. 청중이 원하는 건 권위가 인준된 연사다. 자기 지면을 가지는 것이 GV나 방송으로 넘어가기 위해 상징 자본을 축적하는 경유지가 되어가고 있다.\"",
