		"text": "결코 구체적인 문제를 물은 적이 없다. 문제가 다르므로 그 형세도 달랐다. 중국인은 오직 배워 익히고 설명할 뿐 논쟁을 벌이는 일은 매우 드물었으며, 당파로 나뉘어 각기 주장을 내세우고 대치했다.\n양수명 『동서문화와 철학』 (해제에서 재인용)",
