		"id_str": "793865646425505792",
		"text": "오사와가 '초월적 심급'을 사회 구성적인 개념으로 두었었는지 아니었는지 기억은 안 나는데... 대타자나 거대서사의 경우처럼 같은 문제를 저지르고 있단 점에선 같네요. 초월적 영역의 존재를 전제하고 그 부재로 인한 문제로 설명하니. 다른 설명틀이 필요.",
