		"id_str": "793840728342310912",
		"text": "철학-형이상학은 의미를 추구하는 뇌의 질병. 모든 기성 종교가 (창시자가 설파한 철학과 달리) 공동체적이란 것과 반대항에 위치하는 거울쌍. 가라타니가 후자를 비판하며 전자에 빠져든 것은 '유리바닥'을 보고 만 연약한 인간의 이성으로 어쩔 수 없을지도.",
